import { useState } from 'react'
import Header from './components/Header';
import Events from './components/Events';
import { Event } from './models/event';

interface props {
  events: Event;
}

const App: React.FC<props> = ({events}) => {

  const [list, setList] = useState<Event[]>()

  return (
    <div className="App">
      <Header />
      <Events events={list} />
    </div>
  );
}

export default App;
